{
	static const char replacement = '?';
	static const uint8_t Ss2 = 0x8e;        // Single Shift 2
	static const uint8_t Ss3 = 0x8f;        // Single Shift 3

	//int invalid = 0;

	bytes.resize(3 * str.length() + 1);
	int index = 0;
	for (wchar_t ch : str) {
		unsigned j;
		if (ch < 0x80) {
			// ASCII
			bytes[index++] = static_cast<uint8_t>(ch);
		}
		else if ((j = unicodeToJisx0201(Hi(ch), Lo(ch))) != 0) {
			if (j < 0x80) {
				// JIS X 0201 Latin ?
				bytes[index++] = static_cast<uint8_t>(j);
			}
			else {
				// JIS X 0201 Kana
				bytes[index++] = Ss2;
				bytes[index++] = static_cast<uint8_t>(j);
			}
		}
		else if ((j = unicodeToJisx0208(Hi(ch), Lo(ch))) != 0) {
			// JIS X 0208
			bytes[index++] = static_cast<uint8_t>((j >> 8) | 0x80);
			bytes[index++] = static_cast<uint8_t>((j & 0xff) | 0x80);
		}
		else if ((j = unicodeToJisx0212(Hi(ch), Lo(ch))) != 0) {
			// JIS X 0212
			bytes[index++] = Ss3;
			bytes[index++] = static_cast<uint8_t>((j >> 8) | 0x80);
			bytes[index++] = static_cast<uint8_t>((j & 0xff) | 0x80);
		}
		else {
			// Error
			bytes[index++] = replacement;
			//++invalid;
		}
	}
	bytes.resize(index);
}
